package de.hype.bingonet.client.common.config.constants;

public enum ClickableArmorStand {
    FAIRY_SOUL(""),
    MORNING_EGG(""),
    LUNCH_EGG(""),
    EVENING_EGG("");

    String texture;

    ClickableArmorStand(String textureid) {
        this.texture = textureid;
    }

    public String getTexture() {
        return texture;
    }

    public static ClickableArmorStand getFromTexture(String texture) {
        for (ClickableArmorStand value : ClickableArmorStand.values()) {
            if (value.getTexture().equals(texture)) {
                return value;
            }
        }
        return null;
    }
}
